import React from 'react';
import { deleteAsync } from "../API/API";

const mapper = function(mechanic) {

    return (
        <>
            <td className="col-md-1">{mechanic.nom}</td>
            <td className="col-md-2">{mechanic.prenom}</td>
            <td className="col-md-4">{mechanic.adressemail}</td>
            <td className="col-md-2">{mechanic.garage_fk}</td>
            <td className="col-md-2">
                <button type="button" className="btn btn-primary" onClick={() => window.location.pathname = "Garage/Edit/"+mechanic.id}>Modifier</button>
                <button type="button" className="btn btn-danger"  onClick={async()=>  await deleteAsync("mecano/", mechanic.id)}>Supprimer</button>
            </td>
        </>
    );
};

export default mapper;
